import "../../Styles/transaction.css";
import React from "react";

const ChooseTransactionTypeComponent = ({transactionType,setTransactionType}) => {

    const onChange = e => {
        console.log(e)
        console.log(e.attributes.name.name)
    }
    return (
        <>
        <h4>choose transaction type</h4>
        <div id="choose-transaction" className="X column-gap-2-px blackground">
            <div name="transaction" className="X X-flex-1 X-jc-center X-ai-center transition-ease whiteground"
            onClick={(e)=>onChange(e.target.attributes.name)}
            >
                <h5 name="transaction">transaction</h5>
            </div>
            <div name="fee-bump" className="X X-flex-1 X-jc-center X-ai-center transition-ease whiteground">
                <h5 name="fee-bump">fee bump</h5>
            </div>
        </div>
        </>
    )
}
export default ChooseTransactionTypeComponent;
